import "./Navigator.css";
// import Button from "./Button";

const Navigator = () => {
    return (
        <div>
            <Button text="홈"/>
            <Button text="친구"/>
            <Button text="맵기 평가"/>
            <Button text="마이페이지"/>
        </div>
    )
}

export default Navigator;
